package com.team.postnatalcare.Sanmo;

public class DocnameDTO {
	String name;
	int num;
	public DocnameDTO() {
		super();
		// TODO Auto-generated constructor stub
	}
	public DocnameDTO(String name, int num) {
		super();
		this.name = name;
		this.num = num;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public int getNum() {
		return num;
	}
	public void setNum(int num) {
		this.num = num;
	}
	
	
}
